// HasDataList applies the HasEdge predicate on the "dataList" edge.
func HasDataList() predicate.SysDictType {
	return predicate.SysDictType(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(DataListTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, DataListTable, DataListColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasDataListWith applies the HasEdge predicate on the "dataList" edge with a given conditions (other predicates).
func HasDataListWith(preds ...predicate.SysDictData) predicate.SysDictType {
	return predicate.SysDictType(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(DataListInverseTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, DataListTable, DataListColumn),
		)
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.SysDictType) predicate.SysDictType {
	return predicate.SysDictType(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.SysDictType) predicate.SysDictType {
	return predicate.SysDictType(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.SysDictType) predicate.SysDictType {
	return predicate.SysDictType(func(s *sql.Selector) {
		p(s.Not())
	})
}
